const StyledApp=styled.div`
display:flex;
justify-content:center;
`;

const StyledCard=styled.div`
width: 100vh;
`;

const App = () => {
  return (
    <StyledApp>

      <StyledCard>
      <h3>인기중고</h3>

      <Boxb />


      </StyledCard>


    </StyledApp>


  );
};

export default App
